import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"CLOSE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/CLOSE.md","filePath":"docs/7x/ref_guide/sql_commands/CLOSE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/CLOSE.md"};function r(l,e,n,c,d,h){return o(),t("div",null,e[0]||(e[0]=[s('<h1 id="close" tabindex="-1">CLOSE <a class="header-anchor" href="#close" aria-label="Permalink to &quot;CLOSE&quot;">​</a></h1><p>Closes a cursor.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CLOSE { &lt;cursor_name&gt; | ALL }</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>CLOSE</code> frees the resources associated with an open cursor. After the cursor is closed, no subsequent operations are allowed on it. A cursor should be closed when it is no longer needed.</p><p>Every non-holdable open cursor is implicitly closed when a transaction is terminated by <code>COMMIT</code> or <code>ROLLBACK</code>. A holdable cursor is implicitly closed if the transaction that created it is prematurely ended via <code>ROLLBACK</code>. If the creating transaction successfully commits, the holdable cursor remains open until an explicit <code>CLOSE</code> is run, or the client disconnects.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>cursor_name : The name of an open cursor to close.</p><p>ALL : Close all open cursors.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>WarehousePG does not have an explicit <code>OPEN</code> cursor statement. A cursor is considered open when it is declared. Use the <a href="./DECLARE.html">DECLARE</a> statement to declare (and open) a cursor.</p><p>You can see all available cursors by querying the <a href="./../system_catalogs/catalog_ref-views.html#pg_cursors">pg_cursors</a> system view.</p><p>If a cursor is closed after a savepoint which is later rolled back, the <code>CLOSE</code> is not rolled back; that is, the cursor remains closed.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Close the cursor <code>portala</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CLOSE portala;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>CLOSE</code> is fully conforming with the SQL standard. <code>CLOSE ALL</code> is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./DECLARE.html">DECLARE</a>, <a href="./FETCH.html">FETCH</a>, <a href="./MOVE.html">MOVE</a>, <a href="./RETRIEVE.html">RETRIEVE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',22)]))}const m=a(i,[["render",r]]);export{u as __pageData,m as default};
